def test_retrieve_last_day(mocker, supply_data):
    """
    Test the retrieve_last_day method
    """
    collector = DataCollector()
    # Mocks the method to avoid connecting to the API
    mocker.patch.object(collector, '_retrieve_energy_data', return_value=supply_data[0])

    result_doc = collector.retrieve_last_day()

    assert isinstance(result_doc, dict)
    assert isinstance(result_doc['date'], datetime)
    assert isinstance(result_doc['emissions'], dict)
    
    assert result_doc['emissions']
    assert result_doc == supply_data[1]